script: |
  super -f text -I q99.spq | sort > q99.out

inputs:
  - name: q99.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 / + + col1 NOT BETWEEN + - col2 AND ( + + CAST ( - ( + + ( - + col2 ) ) AS INTEGER ) );
  - name: tab0

outputs:
  - name: q99.out
    data: |
